import { StyleSheet } from "aphrodite";
const styles = StyleSheet.create({
  wrapper: {
    width: "700px",
    marginTop: "125px",
    marginBottom: "125px"
  },
  h: {
    fontFamily: "SFUIDisplay-Bold",
    fontWeight: 700,
    fontSize: "20px",
    paddingBottom: "30px"
  },
  wp: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-between"
  },
  wpi: {
    width: "240px"
  },
  wpi1: {
    fontFamily: "SFUIDisplay-Semibold",
    fontWeight: 600,
    fontSize: "20px"
  },
  wpi2: {
    color: "#acacac",
    lineHeight: "27px",
    fontWeight: 300,
    fontFamily: "SFUIDisplay-Light",
    fontSize: "20px"
  }
});
export default styles;
